	('0cc507aa-5fb2-45e5-969b-6ef110de365a', '2024-11-20 01:40:41.591+00', '3a8aeee9-1a47-4dcb-a82f-43320d985566', 'Give me all of the accounts, the number of posts they''ve made, likes they''ve given, likes they''ve received, comments they''ve given, comments they''ve received and how many days it''s been since their account was first created.', '{"SELECT \"profiles\".\"id\" AS \"profile_id\", \"profiles\".\"name\", \"profiles\".\"createdAt\", COUNT(DISTINCT \"post\".\"id\") AS \"post_count\", COUNT(DISTINCT \"postLikes\".\"id\") AS \"likes_given\", COUNT(DISTINCT \"postLikes_received\".\"id\") AS \"likes_received\", COUNT(DISTINCT \"postComments\".\"id\") AS \"comments_given\", COUNT(DISTINCT \"postComments_received\".\"id\") AS \"comments_received\", DATE_PART(''day'', CURRENT_DATE - \"profiles\".\"createdAt\") AS \"days_since_creation\"
